drop table rating_it2;

CREATE TABLE rating_it2 (
  suburb_id INT NOT NULL,
  suburb VARCHAR(100),
  distance_to_city_rate VARCHAR(100),
  distance_to_city FLOAT,
  residential_rate VARCHAR(100),
  residential_percent FLOAT,
  commercial_rate VARCHAR(100),
  commercial_percent FLOAT,
  health_services VARCHAR(100),
  nearest_public_hospital VARCHAR(100),
  disability_care_rate VARCHAR(100),
  disability_care INT,
  aged_care_rate VARCHAR(100),
  aged_care INT,
  time_to_hospital VARCHAR(50),
  life_style VARCHAR(50),
  population_density FLOAT,
  top_country_of_birth_1 VARCHAR(100),
  top_country_of_birth_2 VARCHAR(100),
  top_country_of_birth_3 VARCHAR(100),
  top_country_of_birth_4 VARCHAR(100),
  top_country_of_birth_5 VARCHAR(100),
  top_language_spoken_1 VARCHAR(100),
  top_language_spoken_2 VARCHAR(100),
  top_language_spoken_3 VARCHAR(100),
  top_language_spoken_4 VARCHAR(100),
  top_language_spoken_5 VARCHAR(100),
  accident_count INT,
  accident_count_rate VARCHAR(100),
  offence_count INT,
  crime_rate VARCHAR(100),
  crime_offence_count INT,
  crime_against_person_rate VARCHAR(100),
  burglary_offence_count INT,
  burglary_rate VARCHAR(100),
  theft_offence_count INT,
  theft_rate VARCHAR(100),
  house_low_quartile FLOAT,
  house_median_quartile FLOAT,
  house_high_quartile FLOAT,
  unit_low_quartile FLOAT,
  unit_median_quartile FLOAT,
  unit_high_quartile FLOAT,
  house_median_quartile_string VARCHAR(50),
  unit_median_quartile_string VARCHAR(50),
  CONSTRAINT PK_rating_it2_suburb_id PRIMARY KEY CLUSTERED (suburb_id)
);






